import React from 'react';
import {
  Button,
  Slider,
  Typography
} from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

const StyledButton = withStyles({
  root: {
    'display': 'block',
    'font-size': '1.4rem',
    'margin': '40px auto 0px',
    'padding': '20px 80px'
  }
})(Button);

const StyledSlider = withStyles({
  root: {
    'margin-top': '40px'
  },
  markLabel: {
    'font-family': "'Alata', sans-serif",
    'font-size': '1.5rem'
  },
  valueLabel: {
    'font-family': "'Alata', sans-serif",
    'font-size': '1rem'
  }
})(Slider);

const TitleText = withStyles({
  root: {
    'font-family': "'Alata', sans-serif",
    'font-size': '2rem'
  }
})(Typography);

export { StyledButton, StyledSlider, TitleText };
